import React from 'react';

function SearchJersey({ searchTerm, onSearchTermChange }) {
    return (
        <input
            type="text"
            placeholder="Search jerseys..."
            value={searchTerm}
            onChange={(e) => onSearchTermChange(e.target.value)}
        />
    );
}

export default SearchJersey;
